import React, { useState } from 'react';
import { Dropdown, Button, Form, InputGroup, Row, Col } from 'react-bootstrap'
import './tracenet.css'


function Tracenet() {

  const [inputs, setInputs] = useState({});
  const [options, setOptions] = useState({});

  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    setInputs(values => ({...values, [name]: value}))
    setOptions(values => ({...values, [name]: value}))
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(inputs);
    console.log(options);
  }











  // // Radio button validation
  const [item, setItem] = useState({ kindOfStand: "", another: "another" });

  const { kindOfStand } = item;

  // const handleChange = e => {
  //   e.persist();
  //   console.log(e.target.value);

  //   setItem(prevState => ({
  //     ...prevState,
  //     kindOfStand: e.target.value
  //   }));
  // };

  // const handleSubmits = e => {
  //   e.preventDefault();
  //   alert(`${kindOfStand}`);
  // };


  // // form validation
  const [validated, setValidated] = useState(false);

  // const handleSubmit = (event) => {
  //   const form = event.currentTarget;
  //   if (form.checkValidity() === false) {
  //     event.preventDefault();
  //     event.stopPropagation();
  //   }

  //   setValidated(true);
  // };
  return (
    <div class="content-wrapper">
      <div class="content">
        <div class="container-fluid">
          <div class="card" >
            <div class="card-header">Sign In using Tracenet credentials</div>
            <div class="card-body">
              <Form noValidate validated={validated} onSubmit={handleSubmit}>
                <Row className="mb-3">
                  <Form.Group as={Col} md="8" controlId="validationCustomUsername">
                    <Form.Label>Username</Form.Label>
                    <InputGroup hasValidation>
                      <InputGroup.Text id="inputGroupPrepend">@</InputGroup.Text>
                      <Form.Control
                        type="text"
                        placeholder="Username"
                        aria-describedby="inputGroupPrepend"
                        required
                        name = "username"
                        onChange={handleChange}
                        value = {inputs.username || ""}
                      />
                      <Form.Control.Feedback type="invalid">
                        Please choose a username.
                      </Form.Control.Feedback>
                    </InputGroup>
                  </Form.Group>
                  <Form.Group as={Col} md="8" controlId="validationCustom01">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                      required
                      type="text"
                      name = "password"
                      placeholder="****"
                      value = {inputs.password || ""}
                      onChange={handleChange}
                    />
                    <Form.Control.Feedback type="invalid">Incorrect Password</Form.Control.Feedback>
                  </Form.Group>
                  <Form.Group as={Col} md="8" controlId="validationCustom02">
                    <Form.Label>Flow</Form.Label><br></br>
                    <Form.Select aria-label="Default select example" size='lg' className='selectflow' name='radio' value={options.radio || ""} onChange={handleChange}>
                      <option>select Flow</option>
                      <option value="1">Farmer Registration</option>
                      <option value="2">Internal Inspection</option>
                      <option value="3">Lot Creation</option>
                      <option value='4'>Crop Entry</option>
                    </Form.Select>
                    <Form.Control.Feedback >Looks good!</Form.Control.Feedback>
                  </Form.Group>

                </Row>

                <Form.Group className="mb-3">
                  <Form.Group as={Col} md="8" controlId="kindOfStand">
                    <Form.Check
                      inline
                      value="Mid Year"
                      type="radio"
                      aria-label="radio 1"
                      label="Mid Year"
                      onChange={handleChange}
                      checked={kindOfStand === "Mid Year"}
                    />
                    <Form.Check
                      inline
                      value="Scope Renewal"
                      type="radio"
                      aria-label="radio 2"
                      label="Scope Renewal"
                      onChange={handleChange}
                      checked={kindOfStand === "Scope Renewal"}
                    />
                  </Form.Group>
                  <Form.Check
                    required
                    label="I agree that this tool will fill the captcha and data on Tracenet website on my behalf."
                    feedback="You must agree before submitting."
                    feedbackType="invalid"
                  />
                </Form.Group>
                <Button type="submit">Submit form</Button>
              </Form>
            </div>
          </div>

        </div>
      </div>
    </div>
  )
}

export default Tracenet
